if(isUserUsingMobile()){for(let pageination of document.querySelectorAll('.page-link-number'))
    pageination.style.display='none'}
    function isUserUsingMobile(){let isMobile=/Android|webOS|iPhone|iPad|iPod|BlackBerry|IEMobile|Opera Mini/i.test(navigator.userAgent);if(!isMobile){let screenWidth=window.screen.width;let screenHeight=window.screen.height;isMobile=(screenWidth<768||screenHeight<768)}
    if(!isMobile){isMobile=(('ontouchstart' in window)||(navigator.maxTouchPoints>0)||(navigator.msMaxTouchPoints>0))}
    if(!isMobile){let bodyElement=document.getElementsByTagName('body')[0];isMobile=window.getComputedStyle(bodyElement).getPropertyValue('content').indexOf('mobile')!==-1}
    return isMobile}